import { BrowserRouter, Routes, Route } from "react-router-dom";

import Layout from "./Layout";
import Home from "./Home";
import About from "./About";
import Contact from "./Contact";

import Men from "./Men";
import Tshirts from "./Tshirts";
import Shirts from "./Shirts";
import Pants from "./Pants";
import Shorts from "./Shorts";
import Homemen from "./Homemen";




const App=()=>
{
return(
<>
   <BrowserRouter>
      <Routes>
          <Route path="/" element={<Layout />} >
            <Route index element={<Home /> } />
            <Route path="home" element={<Home />} />
            <Route path="men" element={<Men/>} >
            <Route index element={<Homemen /> } />
             <Route path="tshirts" element={<Tshirts/>} />
             <Route path="shirts" element={<Shirts/>} />
             <Route path="pants" element={<Pants/>} />
             <Route path="shorts" element={<Shorts/>} />

            </Route>
            <Route path="about" element={<About />} >
                   <Route index element={<AboutCompany /> } />
                   <Route  path="abtcomp" element={<AboutCompany />} />
                   <Route path="abtpdt" element={<AboutProduct />} />
                   <Route path="abtser" element={<AboutService />} />
             </Route>      


            <Route path="contact" element={<Contact />} />
          </Route>
      </Routes>
   </BrowserRouter>
  </> 
  );
}
export default App;
